import React, {PureComponent} from "react";
import Particles from '@tsparticles/react';
import { loadFull } from "tsparticles";
import { particleOptions } from "./particleOptions";

class ParticlesContainer extends PureComponent{
  // this customizes the component tsParticles installation
  customInit= async(engine)=>
   
      // this adds the bundle to tsParticles
    { console.log("custom init called");
        await loadFull(engine);}


  render() {
    console.log("rendering particles container")
    return <Particles options={particleOptions} init={this.customInit} />;
  }
}

export default ParticlesContainer;
